    [],nt"revision_timestamp": "2016-07-27T22:20:31.508149",nt"name": "marsh-and-water-management-plan",nt"isopen":
    false,nt"url": null,nt"notes": "The three freshwater impoundments--North,
    Bill Forward, and Stage Island Pools were constructed by diking off salt marsh on
    the west side of the barrier island in the 1940's and 1950's to create habitat diversity
    in the barrier island ecosystem. All three impoundments are totally dependent on
    precipitation for their source of fresh water, thus diminishing management capabilities.
    Eutrophication, silting of channels and ditches, pest plant expansion, and general
    aging of the impoundments have seriously impacted the habitat diversity and wildlife
    value of them, particularly the North and Bill Forward Pools. Salt marsh habitat
    has been impacted by the extensive ditching conducted during the Depression years.
    This Plan will provide a summary of the past and current marsh and water management
    program and will detail a proposed program for the short-term management of the
    Refuge impoundments and salt marsh habitat. This Plan will also provide an outline
    for an organized approach to achieve long-range goals which require major rehabilitation,
    funding, and planning and development efforts.",nt"license_title": "License
